import "./index.css";

function App() {
  return (
    <div className="App">
      <section class="section">
        <div class="container">
          <h1 class="title">Hello World</h1>
          <p class="subtitle">
            My first website with <strong>Bulma</strong>!
          </p>
        </div>
      </section>
    </div>
  );
}

export default App;
